import React from 'react';
import { toggleinput } from './toggle.styles';

const Toggle = ({ checked, onChange }) => (
  <span className="toggle-control">
    <toggleinput
      className="dmcheck"
      type="checkbox"
      checked={checked}
      onChange={onChange}
      id="dmcheck"
    />
    <label htmlFor="dmcheck" />
  </span>
);

export default Toggle;
